import React from "react";
import Greetings from "./HOC/Greetings"; // Assuming the Greetings component is in a separate file.
import withTimestamp from "./HOC/withTimestamp"; 

// Wrap the Greetings component with the withTimestamp HOC.
const EnhancedGreetings = withTimestamp(Greetings);

function App() {
  return (
    <div className="App">
      {/* Use the EnhancedGreetings component, which includes the timestamp. */}
      <EnhancedGreetings name="John" />
    </div>
  );
}

export default App;
